import React, { Fragment } from 'react';

const FilterCheckbox = ({filter}) => (
    <Fragment>
        <input type="checkbox" id={filter} value={filter} />
        <label for={filter}>{filter}</label>
    </Fragment>
);

export default FilterCheckbox;
